import React from "react";

function Hero({ handleLogout }) {
  return (
    <nav className="flex justify-between w-full h-20 bg-blue-600">
      <h2>Welcome</h2>
      <button onClick={handleLogout}>Logout</button>
    </nav>
  );
}

export default Hero;
